def sum_iter(n):
    total = 0
    for i in range(n + 1):
        total += i
    return total


def head_rec(n):
    if n == 0:
        return

    head_rec(n - 1)
    print("*" * n)


def tail_rec(n):
    if n == 0:
        return

    print("*" * n)
    tail_rec(n - 1)

if __name__ == "__main__":
    n = 5
    tail_rec(n)
    head_rec(n)

    import random
    print(random.random()*5)
